            <div className="Bandeau">
            <Container>
                <Row>
                <div className="Bandeau_calendrier">
                    <Col lg="4">
                            <div className="Bandeau_calendrier">

                            </div>
                    </Col>
                    </div>
                    <Col lg="8">
                            <div className="Bandeau_sponsors">

                            </div>

                    </Col>
                </Row>
            </Container>
            </div>    
        )
    }
}

export default Bandeau;
